import React from 'react';

const Counter = () => {
    let isLogedIn = false;
    return (
        <div>
            if(isLogedIn){
                <div>
                    <h2>Welcome Back</h2>
                </div>
            }else{
                <div>
                    <input type="email" placeholder='enter your email' />
                    <input type="password" placeholder='' />
                </div>
            }
        </div>
    )
}

export default Counter;
